;i:25;i:1504457650;i:26;i:1504457967;i:27;i:1504458272;i:28;i:1504458383;i:29;i:1504458577;i:30;i:1504458863;i:31;i:1504459157;i:32;i:1504459286;i:33;i:1504459422;i:34;i:1504459453;i:35;i:1504512338;i:36;i:1504516428;i:37;i:1504516452;i:38;i:1504520281;i:39;i:1504526245;i:40;i:1504526606;i:41;i:1504526831;i:42;i:1504527327;i:43;i:1504528457;i:44;i:1504528572;i:45;i:1504529147;i:46;i:1504529658;i:47;i:1504535905;i:48;i:1504536085;i:49;i:1504536288;i:50;i:1504614254;i:51;i:1504614695;i:52;i:1504614853;i:53;i:1504615039;i:54;i:1504615126;i:55;i:1504615201;i:56;i:1504615484;i:57;i:1504619759;i:58;i:1504619946;i:59;i:1504620309;i:60;i:1504620430;}','no'),(1391,'_transient_timeout_Parallax-One-update-response','3008599458','no'),(1392,'_transient_Parallax-One-update-response','O:8:\"stdClass\":10:{s:11:\"new_version\";s:5:\"2.1.7\";s:14:\"stable_version\";s:5:\"2.1.7\";s:4:\"name\";s:12:\"Parallax One\";s:4:\"slug\";s:12:\"parallax-one\";s:3:\"url\";s:54:\"https://themeisle.com/themes/parallax-one/?changelog=1\";s:12:\"last_updated\";s:19:\"2017-06-20 12:51:43\";s:8:\"homepage\";s:42:\"https://themeisle.com/themes/parallax-one/\";s:7:\"package\";s:67:\"http://downloads.themeisle.com/Parallax-One/latest/Parallax-One.zip\";s:13:\"download_link\";s:67:\"http://downloads.themeisle.com/Parallax-One/latest/Parallax-One.zip\";s:8:\"sections\";a:2:{s:11:\"description\";s:4546:\"<p>Take a look at some of these amazing websites built with Parallax One.</p>\n<p><span style=\"font-size: x-large;\">its.center<br />\n</span></p>\n<p style=\"margin-left: 490px; text-align: left;\">A business website for IT support center, which uses Parallax One at its simplest form. The site has a clean and professional look and a nice animated full-width homepage header with Parallax effect. Everything on the site is translated into Russian.</p>\n<p><a class=\"theme-button\" href=\"http://its.center/\" target=\"_blank\" rel=\"nofollow\">VIEW THE SITE</a></p>\n<p><span style=\"font-size: x-large;\">buildingrocketts.com<br />\n</span></p>\n<p style=\"margin-left: 490px; text-align: left;\">Another very professional and elegant site, this time for building services. Rockett team has a very specific way of showing its services and works using great sketches, schemes, and images. Everything is simple and organized.</p>\n<p><a class=\"theme-button\" href=\"http://buildingrocketts.com/\" target=\"_blank\" rel=\"nofollow\">VIEW THE SITE</a></p>\n<p>[related_themes title=\"The Possibilities are Countless.\" subtitle=\"See below how you can use this awesome theme and build your website.\"][/related_themes]</p>\n<p>[two_halves]<br />\n[one_half][/one_half]<br />\n[one_half]<br />\nResponsive Design</p>\n<p style=\"text-align: justify;\">Parallax One is completely responsive in order to provide an optimal viewing experience, easy-reading and navigation with a minimum of resizing, panning and scrolling across a wide range of devices. Every element has been tested to ensure layout adaptability by using fluid, proportion-based grids, flexible images to build your activities future proof.</p>\n<p>[/one_half]<br />\n[/two_halves]</p>\n<p>[two_halves]<br />\n[one_half]<br />\nParallax Effect</p>\n<p style=\"text-align: justify;\">Create memorable pages with smooth parallax effect that everyone loves. Upload images into section, put some elements like text, buttons and enjoy a great looking section.<br />\nThe images are displayed dynamically in a list sliding horizontally from one representation to the next one using subtle animations based on lightweight technologies</p>\n<p>[/one_half]<br />\n[one_half]</p>\n<p>[/one_half]<br />\n[/two_halves]</p>\n<p>[two_halves]<br />\n[one_half]</p>\n<p>[/one_half]<br />\n[one_half]<br />\nUnlimited color options</p>\n<p style=\"text-align: justify;\">Parallax One has an advanced theme options panel that enables you to easily customize every element with the color that you desire, thus making your website unique and aesthetically beautiful.</p>\n<p>[/one_half]<br />\n[/two_halves]</p>\n<p>[two_halves]<br />\n[one_half]<br />\nShow them all<br />\nKeep your visitors updated with your activities with our nice built-in feature. Accomplish your objectives by staying engaged with your audience and help them understand, remember your work and act on the information and progress you choose to share.<br />\n[/one_half]<br />\n[one_half]</p>\n<p>[/one_half]<br />\n[/two_halves]</p>\n<p>[two_halves]<br />\n[one_half]</p>\n<p>[/one_half]<br />\n[one_half]<br />\nDesigned to build trust</p>\n<p style=\"text-align: justify;\">You can transform visitors in customers by showing them some trust signs. Adding client testimonials to your website is an integral part of achieving success on the web, strengthen your reputation and build credibility. ParallaxOne was featured as one of the best free themes on <a href=\"http://www.bootstrapzero.com/bootstrap-template/parallax-one\" target=\"_blank\">BootstrapZero</a></p>\n<p>[/one_half]<br />\n[/two_halves]</p>\n<p>[two_halves]<br />\n[one_half]<br />\nBe easily contacted</p>\n<p style=\"text-align: left;\">On the main page the customer finds everything he needs in order to contact you immediately. He is just one click away from you, simply as that, like never before.This theme utilizes Google maps to display exact locations and provide users the ability to interact, visualize and remember a specific place. This navigation guide is intuitive, no complex configurations needed and proves very efficient for visitors to find your location.</p>\n<p>[/one_half]<br />\n[one_half]</p>\n<p>[/one_half]<br />\n[/two_halves]</p>\n<p>[two_halves]<br />\n[one_half]</p>\n<p>[/one_half]<br />\n[one_half]<br />\nOutstanding support</p>\n<p style=\"text-align: justify;\">We are dedicated to Parallax One and our customers. Our fast and reliable support team will reply to all questions within 24 hours. We take care of your website as much as you do and that\'s why support is always 100% free.</p>\n<p>[/one_half]<br />\n[/two_halves]</p>\n\";s:9:\"changelog\";s:27296:\"<p>v2.1.0.12 - 18/08/2016<br />\nChanges:</p>\n<ul>\n<li>Fixed issue with articles embedded in the post page</li>\n<li>Added compatibility with WPPR plugin</li>\n<li>Fixed small code issues</li>\n</ul>\n<p>v2.1.0.11 - 01/07/2016<br />\nChanges:</p>\n<ul>\n<li>Update polish .mo and .po files</li>\n<li>Allow callto protocol in the frontpage contact section</li>\n<li>Allow html content in all the sections main areas</li>\n<li>Remove required actions from Customize</li>\n<li>\nv2.1.0.10 - 02/06/2016<br />\nChanges:</p>\n</li>\n<li>Development</li>\n<li>\nv2.1.0.9 - 18/05/2016<br />\nChanges:</p>\n</li>\n<li>Fixed #358 Issue with Jetpack sharing on latest news</li>\n<li>### 2.1.0.8 - 18/04/2016Changes:* Fixed image not showing in Services section\n<p>For some reasons, in one of our previous commits we changed the link to image and image to link which was causing this issue.<br />\n* Merge pull request #370 from HardeepAsrani/development</p>\n<p>Fixed image not showing in Services section</p>\n<p>### 2.1.0.7 - 14/04/2016</p>\n<p>Changes:</p>\n<p>* Our services small css issue<br />\n* Merge pull request #368 from cristian-ungureanu/development</p>\n<p>Development</p>\n<p>### 2.1.0.6 - 13/04/2016</p>\n<p>Changes:</p>\n<p>* Revert \"!!!changes for general plugin\"</p>\n<p>This reverts commit e008cfceb141af1a928416e93010cfa08921764c.<br />\n* Fixed WordPress 4.5 scrolling issue</p>\n<p>Fixed scrolling issue which was caused after upgrading to WordPress 4.5.<br />\n* Merge pull request #366 from HardeepAsrani/development</p>\n<p>Fixed WordPress 4.5 scrolling issue<br />\n* Merge pull request #353 from cristian-ungureanu/development</p>\n<p>Development<br />\n* Our services small css issue</p>\n<p>### 2.1.0.5 - 19/02/2016</p>\n<p>Changes:</p>\n<p>* Fixed #292 Added character sets<br />\n* #344 latest news titles issue fixed</p>\n<p>issue fixed.<br />\n* Merge pull request #346 from Gouravwp/development</p>\n<p>#344 latest news titles issue fixed<br />\n* #233 - added custom hooks<br />\n* #345 - start page from top if no title and frontpage<br />\n* see the icon in dropdown in customizer<br />\n* fix #347 - woocommerce ratings not displaying properly<br />\n* fix #343 - fix latest news section when wr megamenu is installed<br />\n* #339 - added social icons in team section<br />\n* #329 - make parallax-one seo friendly, only one h1 on page, all images with alt<br />\n* #296 - js loading slow in menu<br />\n* #272 - allow ul and li inside box<br />\n* #218 - add editor style<br />\n* added google icons<br />\n* added new google icons<br />\n* added compatibility with SI CAPTCHA Anti-Spam and change form style<br />\n* Merge pull request #350 from cristian-ungureanu/development</p>\n<p>Development<br />\n* Update translations for polish### 2.1.0.4 - 14/01/2016</p>\n<p>Changes:</p>\n<p>* Fixed #338 Added option to remove pinterest style for Testimonials section and Services section<br />\n* #334, Option to translate the link field from the Services section<br />\n* French translation for Parallax One</p>\n<p>### 2.1.0.3 - 03/12/2015</p>\n<p>Changes:</p>\n<p>* #322 - added control for overlay opacity in first section<br />\n* #311 - line break in textbox is now interpreted as new line<br />\n* #307 - use relative url for images<br />\n* Merge branch \'cristian-ungureanu-development\' into development</p>\n<p>### 2.1.0.2 - 27/11/2015</p>\n<p>Changes:</p>\n<p>* Merge pull request #330 from cristian-ungureanu/development</p>\n<p>Development<br />\n* EDD Compatibility issues</p>\n<p>### 2.1.0.1 - 24/11/2015</p>\n<p>Changes:</p>\n<p>* #316 Change date format issue fixed<br />\n* Merge pull request #324 from Gouravwp/development</p>\n<p>#316 Change date format issue fixed<br />\n* date format issue fixed</p>\n<p>change date format .<br />\n* date format issue fixed</p>\n<p>Change date format<br />\n* Merge branch \'Gouravwp-development\' into development<br />\n* #326 Wrong text domain issue</p>\n<p>text domain issue fixed !<br />\n* Merge pull request #327 from Gouravwp/development</p>\n<p>#326 Wrong text domain issue</p>\n<p>### 2.1.0.0 - 11/11/2015</p>\n<p>Changes:</p>\n<p>* Fixed #291 Date appears twice on blog on moibile<br />\n* Fixed #320 Background image not working well<br />\n* Fixed Background image not working well on mobile</p>\n<p>### 2.0.9 - 29/10/2015</p>\n<p>Changes:</p>\n<p>* #308 added target=\"_blank\"</p>\n<p>added target=\"_blank\" in all Social links<br />\n* Merge pull request #312 from Gouravwp/patch-1</p>\n<p>#308 added target=\"_blank\"<br />\n* Merge pull request #314 from cristian-ungureanu/development</p>\n<p>!!!fixed shop section<br />\n* Fixed #301 and #290 translations issues and added brazilian-portuguese translations</p>\n<p>### 2.0.8 - 23/10/2015</p>\n<p>Changes:</p>\n<p>* Merge pull request #305 from cristian-ungureanu/development</p>\n<p>!!! #290 - fixed translations</p>\n<p>### 2.0.7 - 22/10/2015</p>\n<p>Changes:</p>\n<p>* Merge pull request #295 from cristian-ungureanu/development</p>\n<p>!!!changes for plus plugin<br />\n* Merge pull request #297 from cristian-ungureanu/development</p>\n<p>!!!fixed special characters in boxes<br />\n* Merge pull request #302 from cristian-ungureanu/development</p>\n<p>Development<br />\n* Merge pull request #303 from cristian-ungureanu/development</p>\n<p>!!! #293 - allow just few tags in text box</p>\n<p>### 2.0.6 - 12/10/2015</p>\n<p>Changes:</p>\n<p>* Fixed #208 check JetPack widgets integration<br />\n* Fixed #114 EDD integration<br />\n* Fixed #287 Services images are stretching<br />\n* Fixed #286 Responsive background for single page on mobile</p>\n<p>### 2.0.5 - 07/10/2015</p>\n<p>Changes:</p>\n<p>* Fixed #276 You may be interested in Section in cart<br />\n* Fixed #284 Latest news issue on mobile<br />\n* Fixed #283 Reduced big spaces on mobile<br />\n* Fixed #282 Ribbon background is stretching weird on mobile</p>\n<p>### 2.0.4 - 07/10/2015</p>\n<p>Changes:</p>\n<p>* #272 - html tags a , button , strong, em, br are now allowed in box content<br />\n* #273 - fixed smooth scroll on button click<br />\n* #270 - fixed payment options image<br />\n* Merge pull request #274 from cristian-ungureanu/development</p>\n<p>Development<br />\n* Merge pull request #280 from cristian-ungureanu/development</p>\n<p>Development<br />\n* Fixed translation issues for frontpage buttons<br />\n* Merge pull request #281 from cristian-ungureanu/development</p>\n<p>!!!small changes for plus version### 2.0.3 - 23/09/2015</p>\n<p>Changes:</p>\n<p>* #259 - include font wit wp_enqueue_style<br />\n* #243 - added welcome page<br />\n* #243 - fixed themecheck errors from welcome page<br />\n* #251 - options are hiding when they are empty<br />\n* #243 - added links to documentation<br />\n* #265 - about section allows now a and button tag<br />\n* #264 - fixed sections display on mobile and tablet<br />\n* #268 - fixed sorting in woocommerce shop<br />\n* Merge pull request #263 from cristian-ungureanu/development</p>\n<p>Development</p>\n<p>### 2.0.2 - 17/09/2015</p>\n<p>Changes:</p>\n<p>* this fixes #212 - oEmbed is now responsive<br />\n* Updated screenshot<br />\n* removed unused control header text color from customizer, changed background color of repeater fields in customizer from transparent to white<br />\n* this fixes errors in theme check<br />\n* added links on features boxes<br />\n* #207 - postmatic integration<br />\n* Merge pull request #230 from cristian-ungureanu/development</p>\n<p>this fixes #212 - oEmbed is now responsive<br />\n* #235 - include parallax js only if it is activated<br />\n* #212 - change width and height with max-width and max-height for videos<br />\n* #207 - fixed Postnatic integration<br />\n* #237 - align testimonials<br />\n* #238 - optimize bk<br />\n* #237 - fix the grid js, when all columns are equal, it adds the box in middle<br />\n* #238 - optimize ribbon image<br />\n* #214 accessibility header<br />\n* Update readme.txt<br />\n* markdown for readme</p>\n<p>markdown-ify the readme<br />\n* #214 - added aria rols, #112 - added part of schema markup<br />\n* #112,#214 - removed hybrid code , added tags for markup, validate frontpage<br />\n* #112 - implement schema markup, validating all pages<br />\n* fixed comment did not look the same as in old version<br />\n* Merge pull request #241 from cristian-ungureanu/development</p>\n<p>Development<br />\n* added menu control with keyboard<br />\n* Russian translation. Partial<br />\n* Russian translation. Full<br />\n* #214 - accessibility ready menu in full width and keyboard control<br />\n* Merge branch \'maxkoryukov-translation-RU\' into development<br />\n* #214 - accessibility ready - menu is now responsive<br />\n* #214 - accessibility ready - added alt attribute to images<br />\n* fixed top menu when no item is selected<br />\n* fixed top menu when no menu is selected<br />\n* this fixes #242<br />\n* #214 - small fixes<br />\n* Merge pull request #248 from cristian-ungureanu/development</p>\n<p>Development<br />\n* #250 - site icon control is not visible in customizer<br />\n* Fixed #249, translations for frontpage strings<br />\n* #214 - style links on focus<br />\n* Merge pull request #252 from cristian-ungureanu/development</p>\n<p>Development<br />\n* #249 - added translation support for repeater content<br />\n* Merge pull request #256 from cristian-ungureanu/development</p>\n<p>#249 - added translation support for repeater content### 2.0.1 - 18/08/2015</p>\n<p>Changes:</p>\n<p>* #224 - buttons issue<br />\n* Merge pull request #225 from cristian-ungureanu/development</p>\n<p>#224 - buttons issue<br />\n* Updated pinterest js plugin AND Removed horizontal scroll on mobile<br />\n* change meta viewport<br />\n* Removed logo effect on scroll<br />\n* Update style.css<br />\n* Revert \"change meta viewport\"</p>\n<p>This reverts commit dde5534928ce5fb22d2b0d752def0edac462ba45.<br />\n* #204 - added git button<br />\n* Merge pull request #229 from cristian-ungureanu/development</p>\n<p>Development### 2.0.0 - 12/08/2015</p>\n<p>Changes:</p>\n<p>* CSS issues<br />\n* Added parallax efect on header<br />\n* Replaced pinterest plugin fo Our services and Testimonials<br />\n* Pinterest style on shop<br />\n* Fixed Related and Upsells products issue<br />\n* Parallax issues<br />\n* optimized screenshot<br />\n* #215 - suggest short pixel image optimiser plugin<br />\n* #202 - added textdomain to latest news title<br />\n* use get_template_part instead of include<br />\n* added parallax controls<br />\n* changed name in customizr from header image to header<br />\n* #215 - added sp zip<br />\n* Merge pull request #220 from cristian-ungureanu/development</p>\n<p>Development<br />\n* Fixed #221 Header Parallax effect<br />\n* Fixed #221 parallax effect issue<br />\n* Fixed #221 Header Parallax effect header height issue<br />\n* Fixed #221 Parallax effect header issue<br />\n* Fixed #221 Header parallax issue<br />\n* #217, #117 - added readme.txt , removed unused images<br />\n* Merge pull request #222 from cristian-ungureanu/development</p>\n<p>#217, #117 - added readme.txt , removed unused images<br />\n* Prevent theme from beeing updated by wordpress.org updates<br />\n* Rename Header section to Background<br />\n* update conditon of header<br />\n* Merge pull request #223 from cristian-ungureanu/development</p>\n<p>update conditon of header<br />\n### 1.0.5 - 27/07/2015</p>\n<p>Changes:</p>\n<p>* Home Latest news section redesign<br />\n* #209 - fixed child theme support<br />\n* Merge pull request #210 from cristian-ungureanu/development</p>\n<p>#209 - fixed child theme support<br />\n* Update style.css</p>\n<p>### 1.0.4 - 24/07/2015</p>\n<p>Changes:</p>\n<p>* this fixes #198 - responsive header image<br />\n* #198 - center background image<br />\n* #199 - latest news section appears only if it has posts<br />\n* update to #198 - responsive header image<br />\n* update to #198<br />\n* update to #199<br />\n* Merge pull request #200 from cristian-ungureanu/development</p>\n<p>Development<br />\n* Fixed #136 rtl support<br />\n* Fixed #148 Basic bbpress integration<br />\n* Small css issue<br />\n* Update style### 1.0.1 - 17/07/2015</p>\n<p>Changes:</p>\n<p>* Update style.css<br />\n* #190 - rename function<br />\n* minify js<br />\n* #188 - update tgm<br />\n* #147 - contact placeholders<br />\n* changed the label for contact repeater<br />\n* Merge pull request #192 from cristian-ungureanu/development</p>\n<p>Development<br />\n* fix shop when there are only 2 related products<br />\n* Merge pull request #195 from cristian-ungureanu/development</p>\n<p>fix shop when there are only 2 related products</p>\n<p>### 1.0.0 - 17/07/2015</p>\n<p>Changes:</p>\n<p>* #140 - removed escape html in customizer where a tag is needed<br />\n* speed optimization<br />\n* Merge pull request #187 from cristian-ungureanu/development</p>\n<p>Development<br />\n* blogfix , shop fix, inputs fix<br />\n* Merge pull request #189 from cristian-ungureanu/development</p>\n<p>blogfix , shop fix, inputs fix### 1.0.0 - 15/07/2015</p>\n<p>Changes:</p>\n<p>* #179 - prefix functions<br />\n* #167 - audio/video , #166 - playlist<br />\n* #158 - use get_template_directory_uri<br />\n* this fixes #171 - style form fields<br />\n* fixes #183, #141<br />\n* minify gridalicious js<br />\n* Merge pull request #181 from cristian-ungureanu/development</p>\n<p>Development### 1.0.0 - 13/07/2015</p>\n<p>Changes:</p>\n<p>* #154 - use esc_html__() and esc_html_e() intstead of __() and _e()<br />\n* #149 - made control for sticky header<br />\n* fix menu when it was not displaying<br />\n* #133 - support more tag<br />\n* #155 - use selected() function<br />\n* Merge pull request #178 from cristian-ungureanu/development</p>\n<p>Development</p>\n<p>### 1.0.0 - 09/07/2015</p>\n<p>Changes:</p>\n<p>* this fixes background size<br />\n* Merge pull request #175 from cristian-ung